import Nav from "../components/Nav"

import Form from "../components/Form"

const Contact = () => {
  return (
    <div>
      <Nav />
      <div className="wrapper">
        <Form
          fields={[
            {
              name: "username",
              placeholder: "Name",
              type: "text",
            },
            {
              name: "email",
              placeholder: "Email",
              type: "mail",
            },
            {
              name: "subject",
              placeholder: "Subject",
              type: "textarea",
            },
          ]}
          btnTxt="Play now"
        />
      </div>
    </div>
  )
}

export default Contact
